using System;\nusing System.Collections.Generic;\n\npublic class MyType\n{\n    public int Id { get; set; }\n    public string Name { get; set; }\n\n    // Override Equals and GetHashCode to define equality for MyType\n    public override bool Equals(object obj)\n    {\n        if (obj is MyType other)\n        {\n            return this.Id == other.Id && this.Name == other.Name;\n        }\n        return false;\n    }\n\n    public override int GetHashCode()\n    {\n        return HashCode.Combine(Id, Name);\n    }\n}\n\npublic class MyTypeList : List<MyType>\n{\n    public new bool Contains(MyType item)\n    {\n        // Custom logic for Contains\n        foreach (var listItem in this)\n        {\n            if (listItem.Equals(item))\n            {\n                return true;\n            }\n        }\n        return false;\n    }\n}\n\npublic class Program\n{\n    public static void Main()\n    {\n        var list = new MyTypeList();\n        var item = new MyType { Id = 1, Name = "Item1" };\n        list.Add(item);\n\n        var containsItem = list.Contains(new MyType { Id = 1, Name = "Item1" });\n        Console.WriteLine(containsItem);  // Output: True\n    }\n}